import React, { useState, useEffect } from 'react';
import { api } from '../utils/api';

const AdminOrders = () => {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchOrders();
  }, []);

  const fetchOrders = async () => {
    try {
      const response = await api.get('/orders/admin');
      setOrders(response.data);
    } catch (error) {
      console.error('Error fetching orders:', error);
      setOrders([]);
    } finally {
      setLoading(false);
    }
  };

  const updateOrderStatus = async (orderId, status) => {
    try {
      await api.put(`/orders/${orderId}/status`, { status });
      fetchOrders();
    } catch (error) {
      console.error('Error updating order status:', error);
    }
  };

  if (loading) {
    return <div style={styles.loading}>Loading orders...</div>;
  }

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Manage Orders</h1>

      <div style={styles.ordersContainer}>
        {orders.length === 0 ? (
          <div style={styles.noOrders}>No orders found</div>
        ) : (
          orders.map(order => (
            <div key={order._id} style={styles.orderCard}>
              <div style={styles.orderHeader}>
                <h3 style={styles.orderId}>Order #{order._id.slice(-6)}</h3>
                <span style={styles.orderDate}>
                  {new Date(order.createdAt).toLocaleDateString()}
                </span>
              </div>

              <div style={styles.orderDetails}>
                <p><strong>Customer:</strong> {order.user?.name || 'N/A'}</p>
                <p><strong>Restaurant:</strong> {order.restaurant?.name || 'N/A'}</p>
                <p><strong>Total:</strong> ${order.totalAmount}</p>
                <p><strong>Status:</strong> 
                  <span style={{...styles.status, backgroundColor: getStatusColor(order.status)}}>
                    {order.status}
                  </span>
                </p>
              </div>

              <div style={styles.actions}>
                <select 
                  value={order.status} 
                  onChange={(e) => updateOrderStatus(order._id, e.target.value)}
                  style={styles.statusSelect}
                >
                  <option value="pending">Pending</option>
                  <option value="confirmed">Confirmed</option>
                  <option value="preparing">Preparing</option>
                  <option value="delivered">Delivered</option>
                  <option value="cancelled">Cancelled</option>
                </select>
              </div>
            </div>
          ))
        )}
      </div>
    </div>
  );
};

const getStatusColor = (status) => {
  switch (status) {
    case 'pending': return '#ffc107';
    case 'confirmed': return '#17a2b8';
    case 'preparing': return '#fd7e14';
    case 'delivered': return '#28a745';
    case 'cancelled': return '#dc3545';
    default: return '#6c757d';
  }
};

const styles = {
  container: {
    padding: '2rem',
    backgroundColor: '#fef7f0',
    minHeight: '90vh'
  },
  title: {
    fontSize: '2rem',
    fontWeight: '700',
    color: '#333',
    marginBottom: '2rem'
  },
  ordersContainer: {
    display: 'flex',
    flexDirection: 'column',
    gap: '1rem'
  },
  orderCard: {
    backgroundColor: 'white',
    padding: '1.5rem',
    borderRadius: '15px',
    boxShadow: '0 4px 15px rgba(0,0,0,0.1)'
  },
  orderHeader: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: '1rem'
  },
  orderId: {
    fontSize: '1.2rem',
    fontWeight: '600',
    color: '#333'
  },
  orderDate: {
    fontSize: '0.9rem',
    color: '#666'
  },
  orderDetails: {
    marginBottom: '1rem'
  },
  status: {
    padding: '0.25rem 0.75rem',
    borderRadius: '15px',
    color: 'white',
    fontSize: '0.8rem',
    fontWeight: '600',
    marginLeft: '0.5rem'
  },
  actions: {
    display: 'flex',
    justifyContent: 'flex-end'
  },
  statusSelect: {
    padding: '0.5rem 1rem',
    borderRadius: '20px',
    border: '2px solid #f0f0f0',
    fontSize: '0.9rem',
    cursor: 'pointer'
  },
  loading: {
    textAlign: 'center',
    padding: '4rem',
    fontSize: '1.2rem',
    color: '#666'
  },
  noOrders: {
    textAlign: 'center',
    padding: '4rem',
    fontSize: '1.2rem',
    color: '#666'
  }
};

export default AdminOrders;
